import React from "react";

const Footer = () => {
  return (
    <div className="page-footer">
      <div className="page-footer-inner">
 
      </div>
      <div className="scroll-to-top">
        <i className="icon-arrow-up"></i>
      </div>
    </div>
  );
};
export default Footer;
